B-sides from two Go-Betweens 12-inch singles

&quot;Wait Until June&quot; and &quot;Casanova's Last Words&quot; from &quot;Streets Of Your Town&quot;
&quot;Rock And Roll Friend&quot; and &quot;Mexican Postcard&quot; from &quot;Was There Anything I Could Do?&quot;

The Go-Betweens were an internationally influential indie rock band from Australia, formed by guitarists Robert Forster and Grant McLennan in Brisbane in 1977.
